import { makeStyles, Theme } from "@material-ui/core/styles";

const useStyles = makeStyles((theme: Theme) => ({
    root: {
        width: "100%",
        height: "100%"

    },
    inputWrapper: {
        margin: "10px 0 0px 0",
        width: "100%"
    },
    internalButtonWrapper: {
        marginTop: 12,
        width: "100%"
    },
    subTitle: {
        margin: "0 24px",
    }

}));
export default useStyles;
